AFGHANISTAN NEEDS YOUR HELP 💔🇦🇫

The lives of 37 million innocent people are now in the hands of the Taliban.  Their basic human rights are washed away.  I haven’t been able to sleep the past few nights.  Afghanistan is one of my favorite countries in the world for its kindness and hospitality, and my heart aches for all the wonderful people.  Their lives just changed in the blink of an eye. 

Please check my IG stories for links to fundraisers.  Afghans are begging for your help.  They need food, water, shelter and an escape route for safety. 

The following accounts are great sources to stay up to date on what’s happening on the ground: 

@omar.haidari⁣
@roya_heydari⁣
@theafghan ⁣
@barialaikhoshhal⁣
@nasim.dadfar ⁣
@khyberkhaan

I’ve shared some photos of my time in Afghanistan over the years.  It’s a country that deserves better.  Thank you for listening and please keep the country in your thoughts.
